import React from 'react';
import { Button } from '@geist-ui/react';

function Navbar() {
  return (
    <nav>
      <div className='logo'>
        <h3>Logo</h3>
      </div>
      <div className='navbar-items'>
        <h3>Don't have an account? </h3>
        <Button>Sign up</Button>
      </div>
    </nav>
  );
}

export default Navbar;
